import React from "react";
import Trends from "../assets/Trends.png";
const ContactSection = () => {
  return (
    <section
      className="relative pt-32 text-center bg-center bg-cover"
      style={{ backgroundImage: `url(${Trends})` }}
    >
      <h2 className="absolute inset-0 flex items-center justify-center text-5xl text-white">
        About
      </h2>
    </section>
  );
};

export default ContactSection;
